(297, 'TARTAR DE SALMÃO ', 'Lombo de salmão em cubos, temperado com cebola roxa, pimenta dedo de moça, suco de tangerina, azeite e cebolinha, acompanhado de molho pesto, milho crocante e minissalada de folhas temperada com vinagrete Dijon. ', 42, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(298, 'TARTINE DE SALMÃO', 'Delicados canapés de salmão gravlax, servidos com honey mustard, sour cream com alcaparras e finalizados com redução de aceto balsâmico. ', 42, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(299, 'CEVICHE DE MARACUJÁ ', 'Cubos de tilápia, maracujá, limão siciliano, hortelã, cebola roxa, pimentas biquinho e dedo-de-moça, cheiro verde, alcaparras e milho crocante. Acompanham chips de batata doce.', 42, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(300, 'CEVICHE DE CAJÚ ', 'Cubos de tilápia, cajú, limão siciliano, hortelã, cebola roxa, pimentas biquinho e dedo-de-moça, cheiro verde, alcaparras e milho crocante. Acompanham chips de batata doce.', 42, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(301, 'STEAK TARTARE', 'Tradicional receita francesa de filet mignon delicadamente picado na ponta da faca, servido cru e temperado com ingredientes clássicos como mostardas à l’Ancienne e Dijon, pimenta Tabasco, picles, cebola roxa e alcaparras. Acompanha cesta de pães ou batatas fritas.', 42, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(302, 'CARPACCIO DO LENNON ', 'Servido com honey mustard e tapenade de azeitonas pretas. Acompanha cesta de pães da casa.', 42, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(303, 'CARPACCIO DO RINGO', 'Servido com honey mustard e alcaparras. Acompanha cesta de pães da casa.', 42, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
