(305, 'BRIE PANÉ', 'Bastonetes de queijo brie empanados e fritos, servidos com minissalada de rúcula, torradinhas de pão italiano, mel com pimenta rosa e geleia de pimenta biquinho.', 42, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(306, 'FILÉ À PARMEGIANA', 'Filet mignon empanado na farinha Panko, mussarela e parmesão, regados com molho de tomates da casa e orégano fresco. Acompanham arroz e fritas.', 43, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(307, 'BACALHAU À BRÁS', 'Típico prato português de bacalhau desfiado, ovo mexido, cebola caramelizada, batata palha, azeitonas pretas e salsa. Acompanha arroz branco.', 43, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(308, 'BACALHAU CARBONARA', 'Lascas de bacalhau Gadus Morhua, cubos de bacon, ovo mexido, cebola caramelizada, azeitonas pretas e batatas fritas, finalizadas com alho laminado tostado e azeite. Acompanha arroz branco.', 43, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(309, 'BOUEF BOURGUIGNON ', 'Tradicional prato da culinária francesa, elaborado com cubinhos de carne cozidos lentamente no vinho tinto, acompanhados de bacon, pétalas de cebola caramelizadas, bastonetes de cenoura, cogumelos paris e gratin de batatas.', 43, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(310, 'COQ AU VIN', 'Clássico da culinária francesa, elaborado com sobrecoxas de frango marinadas no vinho tinto, laqueadas ao seu próprio molho e acompanhadas de gratin de batatas.', 43, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(311, 'ABACAXI THAI ', 'Cubos de frango, camarões grelhados, mix de temperos tailandeses com curry, leite de coco, amendoim e pimentões, servidos no abacaxi com arroz de jasmim e chutney de manga. ', 43, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(312, 'OSSOBUCO DI GENNARO', 'Ossobuco bovino, marinado e cozido ao seu próprio molho e acompanhado de risotto de açafrão com rúcula. ', 44, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(313, 'LOMBO WEIZENBIER', 'Lombo suíno marinado e cozido na cerveja de trigo, laqueado ao seu próprio molho e acompanhado de purê de mandioquinha.', 44, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(314, 'FETTUCINNE ALLA CARBONARA', 'Receita clássica da culinária romana: fettuccine puxado com bacon, manteiga, gema de ovo, parmesão e finalizado com salsinha.', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(315, 'FETTUCINNE AL PESTO CON BURRATA', 'Fettucinne puxado na manteiga ao molho pesto com burrata, tomates cereja e finalizado com tapenade de azeitonas pretas, pimenta do reino e azeite.', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(316, 'FETTUCCINE MADONNA', 'Fettuccine al limone com camarões e lascas de salmão grelhadas, pimenta-dedo-de-moça e finalizado com raspas e azeite de limão. ', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(317, 'SOFFIATELLI DELICATO', 'Soffiatelli de massa verde, recheado de 4 queijos com nozes, regados ao molho de tomates da casa e gratinados com parmesão. ', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(318, 'PENNE NORAH JONES ', 'Penne grano duro na manteiga e salsa, servido com molho de tomates da casa com manjericão, iscas de filet mignon e cubinhos de tomate no azeite.', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(319, 'GNOCCHI TOSCANO ', 'Massa artesanal de mandioquinha, puxada na manteiga e sálvia, servida com ragu de linguiça toscana, mix de cogumelos e erva doce.', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(320, 'GNOCCHI AL POMODORO E BASÍLICO', 'Massa artesanal de batatas ao molho de tomates frescos, manjericão, bacon crocante e azeitonas pretas.', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(321, 'GNOCCHI DI MILANO', 'Massa artesanal de batatas ao molho branco com queijo gorgonzola, bacon picado e espinafre, finalizado e gratinado com parmesão.', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
