(323, 'RISOTTO DE PALMITO', 'Tradicional risotto de arroz arbóreo com aliche, azeitonas pretas, pimenta calabresa seca, alcaparras e tomates, finalizado com parmesão e manteiga.', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
