(325, 'RISOTTO A BUARQUE DE HOLANDA', 'Tradicional risotto de arroz arbóreo com gorgonzola, finalizado com parmesão, lâminas de pera grelhadas e folhas de rúcula. ', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(326, 'RISOTTO DE CAMARÕES', 'Tradicional risotto de arroz arbóreo com camarões grelhados e empanados, manjericão e limão siciliano, finalizado com tomates picados e parmesão.', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(327, 'RISOTTO DO PORTO', 'Tradicional risotto de arroz arbóreo com lascas de bacalhau Gadus Morhua no azeite, tomates cereja, azeitonas pretas e manjericão.', 45, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
