(357, 'PARMESÃO RALADO', NULL, 50, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(358, 'MEDICI ERMETE LAMBRUSCO BIANCO (LAMBRUSCO) EMILIA-ROMAGNA ', 'De coloração palha, cristalina e brilhante, tem aromas de frutas cítricas, de polpa branca confitada e sutis toques florais. Sensual dulçor na boca, é fresco e harmônico.', 51, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(359, 'MEDICI ERMETE LAMBRUSCO ROSSO (LAMBRUSCO) EMILIA-ROMAGNA', 'Vibrante expressão de frutas vermelhas e rosas. Doce, fresco e abundantemente frutado no paladar.', 51, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(360, 'MONTE PASCHOAL BRANCO (MOSCATO SUAVE BRANCO) SERRA GAÚCHA', 'Um vinho frisante jovial e descontraído que irá te surpreender. Aromas intensos de frutas, como pêssego, pera e maçã, aromas de jasmim e rosas. Leve e frutado, é refrescante e fácil de beber. Tem a cara do nosso verão.', 52, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(361, 'MONTE PASCHOAL ROSÉ (MOSCATO SUAVE ROSÉ) SERRA GAÚCHA', 'Esse frisante apresenta sedutora tonalidade rosé cereja, e leve desprendimento de finas borbulhas. No aroma, frutas como morango, amoras e lichia. Apresenta também notas florais de gerânios e rosas. Leve, refrescante, adocicado e de paladar frutado. Tem um super custo benefício e vai ser perfeito na reunião de amigos.', 52, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(362, 'MACAW TROPICAL BRANCO (MOSCATO) SERRA GAÚCHA', 'Frisante branco da Casa Perini, tem coloração límpida com tons levemente esverdeados. No aroma é frutado com toques florais. Em boca, revela um frescor vivaz, aliando esse aroma delicado com jovialidade tropical. Versátil, combina com frutas na taça, uma maneira saborosa de aproveitar o verão. ', 52, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(363, 'MACAW TROPICAL ROSÉ (MOSCATO ROSÉ) SERRA GAÚCHA', 'Esse frisante rosé, com a qualidade da Casa Perini, apresenta coloração rosada com relfexos em tons pêssego. Seus aromas são intensos e lembram rosas e frutas vermelhas. No paladar é refrescante, aromático e levemente adocicado. Fácil de apreciar, é uma bebida jovem e irreverente, ideal para momentos de descontração ou celebração com os amigos. Deliciosa com frutas na taça.', 52, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(364, 'HENRI LEBLANC BRUT BLANC DE BLANCS (CHARDONNAY) BOURGOGNE ', 'Seus aromas são de frutas brancas com notas de maçã-verde e pêssegos frescos. Cremoso no paladar, com leveza cítrica de zest de limão. Delicadeza e harmonia ao final de boca, sendo difícil encontrar um espumante francês por tão pouco. ', 53, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(365, 'ARMAND DE CHAMBRAY BRUT BLANC DES BLANCS (UVAS EUROPEIAS) BOURGOGNE', 'De belíssima coloração amarela com reflexos dourados, esse espumante francês é vivo, de borbulhas finas, mesclando sabores cítricos e um final maduro. Possui notas de frutas de verão, com charme efervescente e leve dulçor. Um clássico francês!', 53, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(366, 'ARMAND DE CHAMBRAY ROSÉ (UVAS EUROPEIAS) BOURGOGNE', 'Um espumante de coloração salmão clara, com excelente perlage e paladar suave. Acidez equilibrada e sensação harmoniosa na boca. É fresco, possui corpo médio com notas de frutas como melancia, morango e pêssego. Um charmoso rosé francês para brindar bons momentos!', 53, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(367, 'TERRA SERENA EXTRA DRY ROSÉ (GLERA/MERLOT) VÊNETO', 'Este espumante rosé reúne três adjetivos que mais procuramos em taça: frescor, delicadeza e equilíbrio. Feito em sua maioria com a uva Glera, a mesma do Prosecco, ganhou um toque especial da Merlot, que emprestou aromas de morango, um pouco mais de estrutura e intensidade. Fácil de agradar, é perfeito no verão.', 54, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(368, 'NOCTURNO DULCE NATURAL (TORRONTÉS) MENDOZA', 'Espumante daqueles para se pensar na sua sobremesa predileta. Frutas maduras conversam com toques florais no nariz e aromas de frutas cítricas. Na boca, paladar fresco, pêssego e lichia em calda em equilíbrio e com um longo e delicioso final.', 55, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(369, 'NOCTURNO BRUT ROSÉ (BONARDA) MENDOZA', 'Um espumante rosé que é quase um buquê de flores, com uma intensa tonalidade de rosas, alegre e cativante. Os aromas de cereja, framboesa e morango instigam o paladar de quem admira os rosés mais frutados. Jovem e intenso, é suculento e delicioso!', 55, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(370, 'MONTE PASCHOAL MOSCATEL BRANCO (MOSCATO BRANCO) SERRA GAÚCHA ', NULL, 56, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(371, 'MONTE PASCHOAL MOSCATEL ROSÉ (MOSCATO ROSÉ) SERRA GAÚCHA', NULL, 56, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(372, 'MONTE PASCHOAL BRUT (PROSSECO/GLERA) SERRA GAÚCHA', NULL, 56, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(373, 'MONTE PASCHOAL BRUT ROSÉ (PINOT NOIR) SERRA GAÚCHA', 'A linha de espumantes Monte Paschoal é consagrada e super premiada em vários mercados internacionais. O Brasil está na linha de frente de qualidade na produção de espumantes. Os espumantes são joviais e descontraídos, com aromas intensos de frutas e florais. De perlage persistente, são leves e fáceis de beber, possuindo intenso frescor. De excelente custo benefício, a magia e sabor dos espumantes Monte Paschoal levam você a uma experiência única em todas as ocasiões. ', 56, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(374, 'MONTE PASCHOAL ICE MOSCATEL (MOSCATO) SERRA GAÚCHA', 'O Moscatel Ice foi elaborado a partir de uma nova versão do seu premiado Monte Paschoal Moscatel. É ideal para ser servido com pedras de gelo em uma taça de vinho tinto. O frescor e o sabor marcantes das uvas moscateis e suas inconfundíveis notas frutadas e florais, revelam uma explosão de aromas quando derramado sobre o gelo. Uma experiência incrível que você vai adorar!', 56, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(375, 'CASA PERINI ESPUMANTE MOSCATEL (MOSCATO BRANCA) SERRA GAÚCHA', NULL, 56, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(376, 'CASA PERINI ESPUMANTE BRUT (CHARDONNAY/PINOT NOIR) SERRA GAÚCHA', NULL, 56, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(377, 'CASA PERINI ESPUMANTE BRUT ROSÉ (CHARDONNAY/GAMAY/PINOT NOIR) SERRA GAÚCHA', NULL, 56, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(378, 'CASA PERINI ESPUMANTE MOSCATEL AQUARELA (MOSCATO BRANCA/MOSCATO GIALLO/MOSCATO HAMBURGO) SERRA GAÚCHA', 'Elegantes e primorosamente vinificados, os espumantes Casa Perini representam o melhor do estilo clássico, através do método tradicional Charmat, onde a segunda fermentação ocorre na própria garrafa, conferindo a todos complexidades de aromas e de sabores. Os espumantes são elaborados a partir da seleção das melhores uvas cultivadas no terroir do Vale Trentino da Serra Gaúcha, cenário que reúne as condições ideais para produtos diferenciados que surpreendem os mais exigentes apreciadores. De perlage cremoso e persistente, equilibrado, aromáticos, expressam refrescância e textura delicada. Premiadíssimos no Brasil e no mundo, os espumantes Casa Perini têm a marca do espumante brasileiro. ', 56, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(379, 'ESPUMANTE CASA PERINI DEMI-SEC ICE (BLEND DE UVAS) SERRA GAÚCHA', NULL, 56, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(380, 'ESPUMANTE CASA DEMI-SEC ICE ROSÉ (BLEND DE UVAS) SERRA GAÚCHA', 'Elaborados com uma seleção especial de uvas finas, os espumantes ice apresentam aroma complexo e frutado, excelente formação de espuma e suave dulçor. Consumidos in natura, são elegantes e graciosos. Em taça alta devem ser servidos com pedras de gelo, permanecendo refrescantes por mais tempo. Acrescentando-se frutas como morango, abacaxi ou hortelã e gengibre, moda lançada na Riviera francesa, obtemos uma explosão de sabores e fragrâncias. Experimente!', 56, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(381, 'PORTAS DO SOL (FERNÃO PIRES/VERDELHO) TEJO', 'De cor amarelo palha, esse branco é aromático, fresco e equilibrado. Na boca, é macio com notas de frutos amarelos maduros. Ótimo para ser apreciado sozinho ou acompanhando aperitivos e pratos leves. Este vinho possui excelente relação qualidade e preço.', 57, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(382, 'ALDEIAS DA SERRA (BICAL/CERCIAL/ENCRUZADO/MALVASIA-FINA) DÃO', 'Um vinho português pertencente a designação de origem Vinho Regional Terras do Dão. Tradição e qualidade são a tradução de sua personalidade. Tem aroma de frutas tropicais e na boca apresenta-se elegante e fresco. Perfeito na harmonização com peixes e frutos do mar.', 57, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(383, 'BIANCO PUGLIA (TREBBIANO/MALVASIA) PUGLIA', 'De cor amarelo palha, delicado e fino, possui aroma de frutas verdes com destaque para as notas de pera, maçã e pêssego. Muito agradável, com uma acidez refrescante, elegante e equilibrada. Qualidade aliada a um excelente preço! ', 58, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(384, 'MILUNA BIANCO (MALVASIA BIANCA/CHARDONNAY) PUGLIA', 'A casta internacional Chardonnay encontrou a tradicional Malvasia Bianca, do sul da Itália. O resultado, harmonioso, emprestou aromas florais deliciosos, além de notas de pêssego e abacaxi em calda à taça. Delicado e mineral no paladar, é um vinho branco perfeito para servir mais geladinho e bebericar sem acompanhamento, mas também perfeito para acompanhar pratos leves.', 58, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(385, 'LES FLEURINES (CHARDONNAY) LANGUEDOC-ROUSSILLON', 'Foi nas colinas de argila e calcário do Languedoc-Roussillon que nasceu este delicioso Chardonnay. Sua cor já indica a delicadeza do vinho no nariz e na boca, onde se sobressaem as notas cítricas e minerais. Ótima opção de branco para bebericar ao lado de pratos mais leves, como peixes e saladas. E vive la France! ', 59, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(386, 'FINCA AMADEO (TORRONTÉS) MENDOZA', 'Esse vinho apresenta coloração amarela esverdeada. Seus aromas florais e frutados, trazem no olfato jasmim, rosas e pêssego branco. Fresco, equilibrado e com boa acidez, é fácil de beber e tem tudo a ver com o verão.', 60, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(387, 'FINCA AMADEO (CHARDONNAY) MENDOZA', 'De coloração palha brilhante, apresenta aroma de frutas tropicais como abacaxi, banana e pera, com sutis notas de mel. Cremoso no paladar e com boa acidez, é macio e equilibrado. Excelente para acompanhar pratos leves e saladas.', 60, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(388, 'ZAPA ESTATE (TORRONTES) SAN MARTIN-MENDOZA', 'A Torrontes é uma uva branca emblemática da Argentina, considerada a assinatura dos vinhos brancos argentinos. Esse vinho traz aromas intensos de floral de laranjeiras, rosas e jasmim. Paladar frutado, leve, traz a boca frutas brancas, como lichia e pêssegos brancos. Jovem, de intenso frescor, é agradável, macio e equilibrado.', 60, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(389, 'ZAPA DULCE (CHENIN BLANC) SAN MARTIN-MENDOZA', 'Vinho branco delicioso, com aromas de frutas tropicais e cítricas. Marcado por sua extrema delicadeza e frescor, traz notas de maçãs verdes, abacaxi e pêssego. Leve, com grande equilíbrio e o dulçor natural das uvas Chenin frescas. Vale a pena conhecer. A segunda garrafa acontece fácil.', 60, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(390, 'LA LINDA (TORRONTÉS) MENDOZA', 'De coloração palha com reflexos esverdeados, possui agradáveis aromas florais que remetem a rosas e lavanda. No paladar sua entrada é doce, com uma acidez equilibrada, trazendo notas de pêssegos brancos e um toque de laranjas cristalizadas. Seu corpo leve o torna ideal para desfrutá-lo nas mais diversas ocasiões.', 60, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(391, 'TERRAPURA CLÁSSICO (SAUVIGNON BLANC) VALLE CENTRAL', 'Vinho branco de coloração amarelo palha, carrega intensos aromas de frutas tropicais com um delicado toque vegetal. Em boa é fresco, trazendo sabores cítricos e frutados de limão siciliano, lima da pérsia e pêssego. Perfeito para acompanhar pratos leves e entradas. ', 61, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(392, 'TERRAPURA CLÁSSICO (CHARDONNAY) VALLE CENTRAL', 'Um vinho branco fresco e jovem, traz tradicionais notas de abacaxi, que se misturam com instigantes aromas de pêssego e melão. Apaixonante e agradável, é leve e fácil de beber.', 61, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(393, 'RAVANAL ESTATE (CHARDONNAY) VALLE DEL COLCHAGUA', 'De cor amarela e tons dourados, traz aroma intenso e elegante de frutas tropicais, como maracujá e abacaxi. Paladar expressivo com grande corpo, boa estrutura e persistência. É um vinho refrescante, harmonioso e com acabamento agradável. Acompanha muitíssimo bem peixes e carnes brancas.', 61, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(394, 'RAVANAL ESTATE (SAUVIGNON BLANC) VALLE DEL COLCHAGUA', 'Cultivada em um terroir de clima mediterrâneo, a casta apresenta suas principais características, com a cor amarelo palha, aroma atraente e intenso de frutas cítricas, mamão e pêssego. Em boca, grande volume de elegância, com frutas crocantes????, muito equilíbrio, frescor e acabamento agradável. Vai muito bem com saladas ou pratos com salmão.', 61, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(395, 'CALCU RESERVA ESPECIAL (SAUVIGNON BLANC/SEMILLON) VALLE DEL COLCHAGUA', 'Calcu, significa mágico no idioma Mapuche. Esse Reserva Especial é um clássico corte de duas variedades de uvas brancas que juntas apresentam notas herbáceas, aromas cítricos e frutas tropicais, com toques minerais e vegetais. As uvas provem de vinhedos localizados no sopé da Cordilheira dos Andes, transferindo-lhe cor límpida e brilhante, com o frescor da uva destacando-se em boca, sobre uma estrutura equilibrada, final suculento e persistente. Vinho chileno Premium de alta qualidade.', 61, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(396, 'MONTE PASCHOAL RESERVA (CHARDONNAY) SERRA GAÚCHA', 'Chardonnay de caráter jovem com discreta maturação em madeira, de cor amarelo palha brilhante, apresenta-se com suaves aromas de frutas em calda, notas de amêndoas, especiarias e chocolate branco. Extremamente equilibrado e de sabor persistente, é refrescante no paladar, harmonizando muito bem com massas e molho branco, risottos e carnes brancas.', 62, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(397, 'MONTE PASCHOAL RESERVA (SAUVIGNON BLANC) SERRA GAÚCHA', 'Beneficia-se do cuidado extremo, de ser engarrafado jovem, para preservar ao máximo a qualidade que as melhores uvas conseguem alcançar. Predominam aromas de frutas tropicais frescas como goiaba e maracujá, mescladas com notas herbáceas. Seu paladar equilibrado e refrescante, nos envolve em uma bela experiência sensorial.', 62, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(398, 'CASA PERINI (SAUVIGNON BLANC) SERRA GAÚCHA', 'Vinho jovem de coloração amarelo palha, apresenta aromas intensos e frutados que remetem a lima, flor de maracujá e nuances de erva cidreira. Ao paladar, acidez em equilíbrio, corpo médio e final refrescante. A elegante e aromática Sauvignon Blanc plena em um vinho delicado e charmoso.', 62, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(399, 'CASA PERINI (CHARDONNAY) SERRA GAÚCHA', 'Elaborado com a variedade Chardonnay plenamente adaptada ao solo e clima da Serra Gaúcha, temos um vinho de aromas frutados que lembram abacaxi e maçã verde, com notas florais e mineralidade. Sabor harmonioso e agradável, esse Chardonnay vai te conquistar.', 62, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(400, 'LE CAZELOU ROSÉ IGP PAYS D’OC (SYRAH/GRENACHE NOIR/CINSAULT) LANGUEDOC-ROUSSILLON', 'O clima mediterrâneo e os terroirs do Languedoc oferecem condições ideais para produzir os melhores rosés da França, de excelente qualidade e ótimos preços. Le Cazelou apresenta coloração rosada e brilhante delicada. Logo sentimos seus aromas alegres de frutas frescas como groselhas, morangos, framboesas e suaves contornos cítricos. De paladar refrescante, leve, com final limpo e suculento, muito equilibrado e cheio de vida. É companhia perfeita para um clima de romance.', 63, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(401, 'CLAUDE VAL ROSÉ IGP PAYS D’OC (GRENACHE/CINSAULT/SYRAH) LANGUEDOC-ROUSSILLON', 'Coloração cereja de aparência cristalina. No olfato, cerejas maduras e flores são a tônica. Equilibrado em boca, com bela expressão de fruta suculenta e ótima persistência. Claude Val é uma mistura de variedades de uvas nobres e tradicionais, permitindo-nos obter a expressão máxima do fruto. Este vinho é fácil de beber e reivindica uma fantástica relação qualidade/preço!', 63, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(402, 'EA ROSÉ (CASTELÃO/TOURIGA/SYRAH) ALENTEJO', 'De cor salmão intensa, apresenta jovialidade e exuberância. Aroma com notas marcantes de frutas vermelhas. No palato, ótimo frescor com sabores de morango, groselha, pêssego e lichia. É refrescante com acidez agradável, bom corpo e volume. Fácil de beber bem geladinho, o que proporciona um excelente prazer sensorial.', 64, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(403, 'RAVANAL ESTATE ROSÉ (SYRAH/MERLOT) VALLE DE COLCHAGUA', 'De cor rosada brilhante, traz aromas de frutas tropicais muito frescas como goiaba, tangerina e um toque de maracujá. Em boca, muito frescor e notas cítricas com agradável final. Perfeito para viver uma experiência suave e refrescante.', 65, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(404, 'PEREZ CRUZ LINGUAL ROSÉ (GRENACHE/MOURVEDRE) VALLE DEL MAIPO', 'Vinho rosé espetacular, transmite no olfato frescor, intensos aromas de frutas tropicais e a lembrança do chocolate branco. Equilibrado, com acidez na medida, é refrescante e tem excelente persistência. Traz com ele muita delicadeza, uma grande qualidade e complexidade surpreendente no final de boca!', 65, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(405, 'LAS MORAS OLAS ROSÉ (SYRAH/MALBEC) SAN JUAN', 'Apresenta delicada cor rosa salmão, aromas de frutas vermelhas frescas, como morango, e floral encantador. De corpo leve e refrescante como se espera de um rose no estilo Provençal. Companhia ideal para o verão!', 66, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(406, 'NORTON COSECHA TARDIA ROSÉ (MERLOT) MENDOZA – LUJAN DE CUYO', 'Delicioso vinho elaborado com uvas Merlot colhidas tardiamente, valorizando sua doçura natural. De sabor suave, tem aroma de frutas negras como amora, ameixa e mirtilo. Em boca, possui final persistente e delicado dulçor. Perfeito para viver uma experiência suave e refrescante!', 66, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(407, 'FINCA LAS MORAS ROSÉ (SYRAH) SAN JUAN', 'Este vinho rose argentino surpreende: exibe grande pureza nas notas de morangos frescos entremeadas por toques florais e de especiarias. Na boca, é frutado e vibrante e, ao mesmo tempo, redondo e equilibrado. Encantador para os apreciadores de um bom rose.', 66, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(408, 'ZAPA ESTATE (MALBEC) SAN MARTIN-MENDOZA', 'De coloração rosa com reflexos avermelhados, é um bom jovem, fácil de beber, delicado dulçor e refrescante. Tem notas frutadas que remetem a morangos, cerejas e framboesas. Ideal para aperitivar ou acompanhar qualquer tipo de refeição.', 66, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(409, 'MONTE PASCHOAL ROSÉ (PINOT NOIR) SERRA GAÚCHA', 'De cor rosé claro blush, é primaveril em suas notas florais, rico em aromas e frutas vermelhas como cereja e morango, e frutas negras como amoras e ameixas frescas. No sabor é de paladar leve e refrescante, equilibrando a sensação de leve acidez e doçura, resultando em um rosé elegante, sedoso e refrescante, jóia de nossa Serra Gaúcha.', 67, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(410, 'CASA PERINI ROSÉ SOLIDÁRIO (MERLOT) SERRA GAÚCHA', 'Vinho jovem de coloração rosada de média intensidade. Possui aromas delicados de frutas vermelhas como morango, cereja e pitanga. No paladar, por ser elaborado com uvas Merlot, é macio e apresenta elegante frescor. Vinho leve, com grande vivacidade e harmonia surpreendente pela qualidade e custo benefício.', 67, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(411, 'FAUSTO DI PIZZATO ROSÉ (MERLOT) SERRA GAÚCHA', 'De cor rosada clara e límpida, traz aromas de frutas vermelhas bem frescas como morango, framboesa e cereja, junto a notas de pétalas de rosas. Em boca, é frutado, com acidez e álcool equilibrados. Vivaz, com ótimo frescor, este vinho prima pela qualidade, jovialidade e frescor. Mais um produto premiadíssimo de nossa Serra Gaúcha. Não deixe de conhecer! ', 67, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(412, 'PORTAS DO SOL (TRINCADEIRA, TINTA MIÚDA E CASTELÃO) TEJO', 'Tinto fresco, frutado e jovem, sem passagem por madeira. Esbanja frutas vermelhas, tem taninos de boa textura, ótima acidez e final agradável. Fácil de beber, um verdadeiro achado do Tejo, com excelente relação qualidade e preço.', 68, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(413, 'ALDEIAS DAS SERRAS (TOURIGA NACIONAL, TINTA RORIZ, RUFETE E JAEN) ALENTEJO', 'Vinho de coloração vermelho intenso. No paladar é redondo e equilibrado. Possui o doce aroma de frutas, formado por uvas de muita qualidade e recomendado para qualquer ocasião. É um vinho saboroso e muito intenso.', 68, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(414, 'EA (ARAGONEZ, TRINCADEIRA, ALICANTE BOUSCHET, SYRAH E CASTELÃO) ALENTEJO', 'Um dos mais famosos vinhos portugueses da região do Alentejo. Apresenta coloração grená, com aromas predominantemente frutados e com notas de vegetais. Vinho jovem, é bastante fresco e fácil de beber. Pela fama e qualidade, vale a pena conhecer.', 68, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(415, 'DON LUCIANO (TEMPRANILLO) LA MANCHA', 'Um rótulo de sucesso, sendo o vinho originário de La Mancha mais vendido da Espanha. É um vinho límpido, de coloração rubi e nuances violetas. Seus aromas são predominantemente frutados, aparecendo notas de frutas vermelhas maduras. Em boca, é um vinho com boa presença de taninos, equilibrado, elegante e muito prazeroso. ', 69, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(416, 'REY DE COPAS (TEMPRANILLO) LA MANCHA', 'Belíssima expressão de fruta da Tempranillo, com morango e framboesa. Muito macio, taninos sutis e aveludados, e ótimo frescor para contrabalancear. Práticas sustentáveis em todos os setores da vinícola, em especial nos vinhedos. Excelente relação preço/prazer!', 69, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(417, 'BODEGAS PABLO ALGAIRÉN TINTO (TEMPRANILLO) CARIÑENA', 'Autêntico Tempranillo espanhol. Coloração viva e aromas de framboesas e morangos. Em boca, possui corpo leve que não esconde a vivacidade das frutas, que se fixam às bochechas graças aos taninos bastante presentes e equilibrada acidez. Um clássico espanhol! ', 69, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(418, 'TALMA GARNACHA (GARNACHA) MURCIA', 'De cor rubi com reflexos violáceos, esse vinho é um maravilhoso exemplar da costa mediterrânea. Frutos vermelhos e negros maduros, exalam da taça em notas olfativas. Agradável, com corpo médio e taninos equilibrados, é elegante e de final persistente. A uva Garnacha é extremamente densa e complexa, proporcionando muito sabor na degustação do vinho.', 69, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(419, 'ROSSO PUGLIA (MONTEPULCIANO) PUGLIA', 'A boa surpresa neste tinto pugliese é seu olfato exótico marcado por notas de chá preto. Na boca, mostra-se um vinho jovem e agradável, com taninos suaves e bem polidos, acompanhados de bastante fruta vermelha, mostrando a tipicidade da Montepulciano e dos vinhos do sul da Itália. Macio e equilibrado, fácil de beber.', 70, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(420, 'MILUNA ROSSO (MALVASIA NERA, NEGROAMARO E SANGIOVESE) PUGLIA', 'O Miluna Rosso é um rótulo de entrada aos deliciosos vinhos da Puglia. Apresenta exuberantes aromas de cerejas maduras e ameixas negras com pitadas de especiarias. Encorpado e com taninos redondos, o vinho é equilibrado e fácil de beber e agradar. Um ótimo italiano para bebericar numa roda com os amigos ou para harmonizar com um tradicional “antipasti”.', 70, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(421, 'PALAGETTO CHIANTI (SANGIOVESE, MERLOT, CANAIOLO E COLORINO) CHIANTI', 'Os fãs de vinhos italianos sabem como não é fácil encontrar um Chianti bem feito por um preço tão bom quanto este. Com intensa cor rubi, mostra notas de cerejas frescas, especiarias e flores, que vão do nariz à boca, onde o vinho se mostra macio e fresco, com taninos na medida exata para acompanhar com riqueza os mais diversos pratos. ', 70, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(422, 'LES ORMEAUX (MERLOT/CABERNET FRANC/ CABERNET SAUVIGNON) BORDEAUX', 'De coloração rubi claro, límpida e brilhante, esse legítimo Bordeaux traz em seus aromas notas frutadas de ameixas, cerejas e framboesas. O paladar é bem estruturado e equilibrado com taninos discretos e macios que convidam para uma segunda taça. Vinho extremamente versátil nas harmonizações e ideal para se beber com os amigos!', 71, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(423, 'LES FLEURINES ROUGE PAYS D’OC (SYRAH)  LANGUEDOC-ROUSSILLON', 'Este rótulo exibe a expressão mais clássica da uva Syrah. Aromas de ameixas e amoras frescas ganham notas de violeta que tornam mais agradável seu paladar. De corpo médio e taninos suculentos, faz com que o vinho seja uma excelente combinação para um prato típico da França, o Filet au Poivre.', 71, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(424, 'CLAUDE VAL ROUGE (GRENACHE, CARIGNAN, SYRAH E MERLOT) LANGUEDOC-ROUSSILLON', 'Vinho tinto francês frutado, redondo e que não passa por barrica, expressando a pureza da fruta. Tem intensos aromas de ameixa e frutas vermelhas maduras, além de toques de violeta e especiarias. Na boca é um vinho leve, macio, com textura de taninos polidos, boa acidez e um final refrescante com notas de alcaçuz.', 71, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(425, 'COUTEAUX BOURGUIGNON ROUGE (PINOT NOIR E GAMAY) BOURGOGNE ', 'Belíssimo tinto francês, sem passagem por madeira, o que destaca os cativantes aromas de cerejas, ameixas e morangos, bem como notas florais, terrosas e de ervas frescas. Frutado, suculento e gostoso de beber, tem acidez refrescante, taninos macios e final persistente. Um clássico vinho da Borgonha!', 71, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(426, 'CONCHA Y TORO RESERVADO (CABERNET SAUVIGNON) VALLE DEL MAIPO', 'Aroma de frutas vermelhas frescas e notas florais. É frutado, equilibrado, fácil de beber e muito versátil.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(427, 'CONCHA Y TORO RESERVADO (MERLOT) VALLE DEL MAIPO ', 'Possui aromas de frutas vermelhas maduras com notas de pimenta e tostado, taninos suaves e boa persistência. Excelente vinho de entrada.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(428, 'CONCHA Y TORO RESERVADO (MALBEC) VALLE DEL MAIPO ', 'Vinho tinto de cor vermelho rubi. Seu aroma traz excelente ataque de frutas negras e vermelhas, com um leve toque herbáceo. Na boca tem corpo médio e taninos redondos, sendo bastante frutado.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(429, 'CONCHA Y TORO RESERVADO (CARMENÈRE) VALLE DEL MAIPO ', 'Coloração rubi intensa com reflexos violeta, carrega aroma de frutas negras maduras e notas herbáceas. Na boca é frutado e de bom corpo, com taninos presentes. ', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(430, 'TERRAPURA (CARMENÈRE) VALLE CENTRAL ', 'De linda cor vermelho rubi, esse vinho traz aromas profundos e expressivos de morangos, cerejas e um toque de pimenta. Na boca, é sedoso, com taninos doces e um final longo e agradável, com um toque elegante de baunilha. Simplesmente delicioso.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(431, 'TERRAPURA (CABERNET SAUVIGNON) VALLE CENTRAL', 'De coloração vermelha com tons violáceos, este Cabernet Sauvignon apresenta notas de frutas vermelhas, amoras e ameixas, com aromas florais suaves. Em boca é macio, frutado e com taninos moderados, remetendo a figo e framboesa. Possui um final longo e agradável.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(432, 'RAVANAL ESTATE (CABERNET SAUVIGNON) VALLE DE COLCHAGUA', 'De coloração vermelho rubi intenso, concentra aromas de frutos maduros como ameixas e amoras, e leve toque de menta que entrega complexidade e elegância. Possui excelente estrutura equilíbrio, com taninos sedosos e final agradável. Perfeito no acompanhamento de carnes vermelhas, como filés, hambúrgueres e cordeiros.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(433, 'RAVANAL ESTATE (MERLOT) VALLE DE COLCHAGUA', 'Esse vinho apresenta cor vermelho cereja com flashes de violeta. No nariz, aromas intensos de frutas vermelhas e notas suaves de chocolate e especiarias. Equilibrado, boa estrutura, grande concentração, com taninos suaves e acabamento muito agradável. Em sua mesa vai surpreender!', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(434, 'RAVANAL ESTATE (CARMENÈRE) VALLE DE COLCHAGUA', 'Esse tinto demonstra a perfeita adaptação da uva francesa Carmenère ao hemisfério sul quando cultivada e vinificada como maestria. O Ravanal Carmenère ostenta o potencial da casta de forma inigualável. Aroma intenso de frutas vermelhas e especiarias. No paladar, o sabor de ameixas e amoras. Bem estruturado, taninos suaves e um acabamento impecável. ', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(435, 'TERRANOBLE (CABERNET SAUVIGNON) VALLE CENTRAL', 'Vinho de cor vermelho-rubi com intensos aromas de frutas vermelhas e chocolate. Na boca traz um agradável sabor de frutas frescas, com taninos macios e acidez equilibrada. Seu final é longo e frutado. Um Cabernet intensamente prazeroso e de excelente relação qualidade/preço.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(436, 'TERRANOBLE (MERLOT) VALLE CENTRAL', 'O Vale do Maule é um dos melhores terrenos para a Merlot no Chile. Por lá, a Terranoble criou este exemplar repleto de frutas e flores, com paladar macio, equilibrado e com leve toque de carvalho. Vinho amistosamente frutado de ameixa, com leves contornos tostados e de especiarias. É redondo e equilibrado, saboroso e de intenso prazer.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(437, 'TERRANOBLE (CARMENÈRE) VALLE CENTRAL ', 'Nos vales chilenos são produzidos os melhores Carmenère. Esse vinho se enquadra nessa máxima. Apresenta fruta negra vibrante no olfato, com notas apimentadas, herbáceas e de chocolate meio amargo. Na boca é macio, com excelente estrutura e persistência. Qualidade absoluta pra quem busca um bom Carmenère!', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(438, 'PEREZ CRUZ RESERVA (CABERNET SAUVIGNON) VALLE DEL MAIPO', 'Esse Cabernet Reserva é um rótulo da Denominação de Origem (D.O.) do Valle del Maipo no Chile. Elabora pela Viña Perez Cruz, um dos mais renomados produtores do país, possui coloração rubi intensa, aromas de frutas vermelhas maduras, baunilha e sutis toques de pimenta negra. Bem estruturado com taninos maduros e final suculento. Desfruta de excelente pontuação da crítica especializada, como os 91 pontos na avaliação de Robert Parker ou os 95 pontos da Revista Decanter. Custo/benefício e qualidade incontestáveis. Pode provar!', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(439, 'ESPINO RESERVA (CABERNET SAUVIGNON) VALLE DEL MAIPO', 'A consagrada vinícola de Willian Fèvre costuma produzir seus vinhos da forma mais natural possível e nesse Cabernet buscou expressar a pureza da casta, juntamente com o envelhecimento em barrica francesa. De cor rubi clara, apresenta aromas de framboesas, amoras e groselhas e um leve toque de floral e tostado. Redondo e equilibrado em boca, possui taninos macios e sedosos. Um Cabernet Reserva de respeito.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(440, 'ESPINO RESERVA (CARMENÈRE) VALLE DEL MAIPO', 'Oriundo de região vinícola privilegiada aos pés da Cordilheira dos Andes, onde se produz uvas de alta qualidade, esse clássico Carmenère vermelho púrpura, depois de oito meses em barrica de carvalho, exibem grande complexidade aromática, com notas pronunciadas de frutas negras e especiarias. Em boca é denso, generoso, encorpado de taninos aveludados e paladar amplo e envolvente. Companhia gastronômica ideal para massas, risottos e carnes.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(441, 'ESPINO RESERVA (PINOT NOIR) VALLE DEL MAIPO', 'De cor rubi intensa, após seis meses em barrica de carvalho francês, esse Pinot nos traz no aroma morangos e cerejas, com sutis notas minerais e ligeiro acabamento picante. No paladar é possível sentir presente a elegância que é típica da casta, taninos contidos e macios. Tem boa estrutura, é leve e de sabor intenso e prolongado, trazendo imediato prazer ao paladar. A vinícola boutique franco chilena de Willian Frève superou-se na produção desse Pinot.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(442, 'CALCU RESERVA ESPECIAL (CABERNET SAUVIGNON) VALLE DE COLCHAGUA', 'Calcu Reserva Especial é a nova expressão de um vinho que nos convida a experimentar o inesperado. De cor vermelho clara e profunda, com passagem de 10 meses em barrica de carvalho francês, apresenta aroma de frutas negras e vermelhas, frescas e bem maduras, chocolate e leve tostado. De paladar envolvente e bom corpo, taninos macios, bem estruturado e final envolvente. Vinho exuberante e de grande personalidade.', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(443, 'CALCU RESERVA ESPECIAL ASSEMBLAGE (CABERNET SAUVIGNON, CARMENÈRE E MALBEC) VALLE DE COLCHAGUA', 'Calcu é um projeto familiar com uma destacada trajetória na produção de vinhos premium. Esse vinho de coloração rubi profunda, elaborado a partir de um blend maravilhoso de uvas, apresenta um bouquet de frutas negras, leves notas de chocolate e um toque floral. Com o envelhecimento em barris de carvalho por dez meses, apresenta no paladar taninos vivos, levemente adocicados, suaves e de persistência frutada. É um belo exemplar dessas emblemáticas variedades. ', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(444, 'CALCU RESERVA ESPECIAL (CABERNET FRANC) VALLE DE COLCHAGUA', 'As uvas que compõe esse vinho são de um terroir granítico, com grande concentração de argila e onde as brisas oceânicas que percorrem os vinhedos, nos propiciam um Cabernet Franc fresco e frutado, complexo e elegante. Em seu aroma percebemos notas limpas e acentuadas de frutas vermelhas, toques florais e suave madeira. Com envelhecimento em barricas de carvalho francês, é encorpado, bem equilibrado, com taninos doces e macios. Vinho vibrante e uma excelente companhia gastronômica. ', 72, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(445, 'YUYO (MALBEC/BONARDA) MENDOZA', 'Vinho de coloração vermelho brilhante, fresco, jovem e muitíssimo fácil de apreciar. Paladar equilibrado logo destacam-se notas de frutas vermelhas. Vinho de excelente qualidade e ótimo custo/benefício, harmoniza muito bem com carnes e massas. ', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(446, 'FINCA AMADEO (CABERNET SAUVIGNON) MENDOZA', 'Vinho de cor vermelho rubi brilhante com tons violáceos. Em nariz, frutas negras, especiarias e ervas silvestres. Possui acidez média, taninos finos, sendo um casamento perfeito com carnes grelhadas, massas e queijos.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(447, 'FINCA AMADEO (MALBEC) MENDOZA', 'Vinho de cor rubi com tons violáceos, apresenta aromas de frutas vermelhas e pretas como morango, ameixa e geleia de amora. De acidez média e taninos macios, é fácil de beber e harmoniza com carnes vermelhas e massas com molhos.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(448, 'LAS MORAS OLAS (MALBEC) SAN JUAN', 'Elaborado com uvas colhidas manualmente e fermentadas em barris de carvalho, apresenta profunda cor rubi, aromas de frutas vermelhas frescas e violeta. Vinho jovem, redondo e fresco, em um contexto de prazer imediato, adequado para se beber no verão com os amigos.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(449, 'LAS MORAS OLAS (CABERNET SAUVIGNON) SAN JUAN', 'Para preservar a pureza da fruta, este vinho não passou por barricas. Possui coloração púrpura intensa das frutas negras, ameixa e cassis. De corpo leve e fresco, apresenta taninos macios e discretos. Casa bem com o verão e harmoniza com carnes nobres.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(450, 'ZAPA ESTATE (CABERNET SAUVIGNON) MENDOZA', 'Da região vinífera de Mendoza, esse Cabernet jovial surpreende. Cor vermelha profunda, traz o aroma de frutos vermelhos e pretos maduros, com notas de geleia e figueira. Complexo, oferece boa estrutura com taninos maduros e suculentos e persistência em boca. Leve e fácil de beber, é excelente companhia gastronômica.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(451, 'ZAPA ESTATE (MALBEC) MENDOZA', 'Da região vinífera de Mendoza, esse Cabernet jovial surpreende. Cor vermelha profunda, traz o aroma de frutos vermelhos e pretos maduros, com notas de geleia e figueira. Complexo, oferece boa estrutura com taninos maduros e suculentos e persistência em boca. Leve e fácil de beber, é excelente companhia gastronômica.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(452, 'ZAPA ESTATE (MALBEC) MENDOZA', 'De coloração rubi intensa, em seu bouquet apresenta abundância de frutas como cereja, morango, groselha, mirtilo, ameixas e toques florais de violeta. Em boca é frutado, equilibrado e com taninos redondos e persistentes. Vinho leve e muito agradável de beber.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(453, 'ZAPA ESTATE BLEND (CABERNET SAUVIGNON/MALBEC/PETIT VERDOT) MENDOZA', 'Os terroirs de Mendoza nos trazem um blend com três variedades francesas plenamente adaptadas ao sopé dos Andes. De cor vermelho rubi intensa, descansa seis meses em barrica de carvalho para depois derramar em taça seus aromas de frutas negras, chocolate e florais. Bem frutado, possui taninos marcantes e elegantes e com excelente final. Intensamente prazeroso, um blend instigante do qual dificilmente uma só garrafa será o bastante.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(454, 'INTIS (MALBEC) SAN JUAN', 'Sabe um vinho tinto frutado, redondinho por um preço que não pesa no bolso? O Intis Malbec é assim. Os aromas são focados na fruta madura levemente contornada por especiarias. Na boca, corpo médio, boa acidez, macio e fresco, equilibrando o conjunto. Fácil de beber, um excelente Malbec argentino.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(455, 'INTIS (SHIRAZ) SAN JUAN', 'Vinho de coloração púrpura luminosa. Expressivo nos aromas de figo fresco, amora e pimenta quebrada. O ataque em boca é macio, com taninos polidos. Esse tinto argentino vem com a grife da vinícola Finca Las Moras, uma das mais importantes vinícolas de San Juan. Experimente!', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(456, 'CIRCUS (PINOT NOIR) MENDOZA', 'A Pinot Noir caiu nas graças dos apreciadores de vinhos mais jovens por seu frescor e leveza. Os típicos aromas de frutas vermelhas estão lá desde o momento em que a garrafa é aberta, concentrados e misturados a nuances de cogumelo e notas defumadas. Em boca, açúcar queimado, morangos, framboesas e amoras frescas encontram taninos que são equilibrados pela boa acidez e um leve toque herbáceo. Um exemplar que não nega seu caráter moderno!', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(457, 'CIRCUS (MALBEC) MENDOZA', 'Este Malbec típico exemplar do novo mundo, apresenta no olfato, as nuances amadeiradas, as frutas vermelhas e o caramelo, envolvido por uma nota de violeta delicada. Em boca, força e elegância com taninos bem construídos, presença da pimenta preta e certo dulçor das frutas com caramelo. Vinho marcante e agradável, é a escolha certa para o seu jantar. Compre uma garrafa agora e outra para guardar na adega por um ano.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(458, 'CIRCUS BLEND (BONARDA, SYRAH E TEMPRANILLO) SAN JUAN', 'Gastronômico é a palavra que melhor descreve este tinto argentino feito de um corte inusitado de Bonarda, Tempranillo e Syrah. Aromas de ameixas maduras e azeitonas combinam-se a notas de pimenta-preta. Saboroso e convidativo, com taninos macios e corpo médio, deixa o paladar preparado para um banquete tipicamente italiano. Acompanha muitíssimo bem desde as tradicionais brusquetas de tomate e manjericão ou uma tábua de queijos e embutidos, até um filé mignon à parmegiana.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(459, 'CIRCUS BLEND (BONARDA, SYRAH E TEMPRANILLO) SAN JUAN', 'Gastronômico é a palavra que melhor descreve este tinto argentino feito de um corte inusitado de Bonarda, Tempranillo e Syrah. Aromas de ameixas maduras e azeitonas combinam-se a notas de pimenta-preta. Saboroso e convidativo, com taninos macios e corpo médio, deixa o paladar preparado para um banquete tipicamente italiano. Acompanha muitíssimo bem desde as tradicionais brusquetas de tomate e manjericão ou uma tábua de queijos e embutidos, até um filé mignon à parmegiana.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(460, 'FINCA LAS MORAS (BONARDA) SAN JUAN', 'Vinho de coloração rubi de média intensidade, esse vinho de uvas Bonarda é a pura expressão da fruta. Exibe deliciosas notas de amora e framboesa madura com nuances de baunilha e café. Tem taninos redondos e um final de boca rico em frutas vermelhas. Se você não conhece a Bonarda, bora conhecer? Vale a pena! ', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(461, 'FINCA LAS MORAS (MALBEC) SAN JUAN ', 'Vinho de coloração violeta, aromas de frutas vermelhas como cerejas e ameixas prevalecem. Rico e frutado, redondo e encorpado, esse vinho se mostra fresco e traz ótima suculência em boca com a clássica elegância dos vinhos Malbec. Ideal com massas de molho vermelho e carnes.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(462, 'FINCA LAS MORAS (SHIRAZ) SAN JUAN', 'Vinho de coloração rubi com borda ligeiramente violácea. Nele sentimos a pureza da fruta, os aromas de amora e ameixa com boa precisão e a presença da pimenta negra. Muito amável em boca e fácil de gostar, os taninos finos e a ótima acidez, nos trazem um vinho agradável de beber e de ótima categoria.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(463, 'LA LINDA (MALBEC) MENDOZA ', 'Um dos mais apreciados vinhos do produtor Luigi Bosca, o La Linda Malbec apresenta uma intensa cor vermelho púrpura escuro com aromas de frutas vermelhas e especiarias doces. Na boca, boa estrutura, taninos macios e acidez refrescante. Tem corpo médio, textura sedosa e um final persistente. Esse é um grande vinho, sendo daqueles tintos avaliados como uma “boa compra”. Imperdível!', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(464, 'LA LINDA (CABERNET SAUVIGNON) MENDOZA ', 'Maravilhoso Cabernet, estabilizado em barricas de carvalho. De cor intensa vermelho rubi escuro com aromas de frutas negras e especiarias. Excelente equilíbrio em boca, com taninos sedosos e longo final frutado. Além da grande qualidade, é versátil na harmonização com risottos, massa alla carbonara, brusquetas e carnes vermelhas.', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(465, 'AMALAYA (MALBEC) SALTA ', 'O Amalaya é um impressionante vinho tinto de Malbec.  Surpreende ainda mais, pois suas uvas são cultivadas a 1.800 metros de altitude. Pode esperar por um vinho tinto com aromas intensos de morango, cerejas maduras, com toques de pimenta e especiarias. Na boca, traz ainda um toque de baunilha, graças ao envelhecimento em barricas francesas. Redondo e macio, tem um final suculento. Estruturado e aveludado, forma um conjunto que nos conduz a um extremo prazer e a sensação de “achei o meu vinho ideal”!', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(466, 'LAS MORAS BLACK LABEL (MALBEC) SAN JUAN', 'Esse vinho é um clássico da Bodega Finca Las Moras. Com passagem por 15 meses em barrica de carvalho francês, tem uma cor violeta intensa com tons brilhantes. Aroma frutado poderoso e bem delineado no nariz, com figo, framboesa e chocolate. Na boca é concentrado, com poderosa expressão frutada e taninos polidos. Prazeroso frescor com final longo e maduro. Uma das estrelas da nossa carta, é imperdível para quem deseja conhecer um grande vinho!', 73, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(467, 'MONTE PASCHOAL RESERVA (CABERNET SAUVIGNON) SERRA GAÚCHA', 'Seu estilo e identidade estão presentes em sua coloração forte e tonalidade vermelho violeta. Com breve amadurecimento e barricas de carvalho, no aroma ressaltam especiarias finas, frutas passas, caramelo, café e notas terrosas. Maduro e complexo, tem paladar equilibrado, acidez refrescante e taninos maduros que acariciam o paladar. Muito estilo e requinte em um vinho nacional de ótimo custo/benefício.', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(468, 'MONTE PASCHOAL RESERVA (MERLOT) SERRA GAÚCHA', 'Merlot ultra elegante, de cor vermelho vivo, de aroma intendo e frutado que só as melhoras uvas conseguem alcançar. Frutas vermelhas e negras e notas de chocolate e champignon. Em boca, é equilibrado, com textura aveludada, acidez refrescante, sensação intensa e persistente de fruta madura. Excelente harmonização com filés, hambúrgueres e cordeiros, é um vinho que nos proporciona e uma bela percepção sensorial. ', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(469, 'FAUSTO DE PIZZATTO (CABERNET SAUVIGNON) SERRA GAÚCHA', 'De cor vermelho rubi intenso, nos aromas apresenta amoras, cerejas e ameixas, com notas de especiarias e leve mentolado. Na boca, bom corpo, frutado, com taninos de textura marcante. Boa parte da excelente produção da Pizzatto é exportada para a Europa, como esse vinho leve, mas de boa complexidade, que tem ótima pontuação e nos surpreende pela qualidade.', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(470, 'FAUSTO DE PIZZATTO (MERLOT) SERRA GAÚCHA', 'Das melhores parcelas dos vinhedos da Pizzatto é gerado esse Merlot com excelente complexidade, após passagem em barril de carvalho. Vermelho rubi traz aromas de frutos vermelhos e negros maduros, cereais e toque sutil de chocolate. Em boca, taninos macios e dóceis com final persistente. Nesse Merlot muita elegância e personalidade do vinho nacional.', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(471, 'FAUSTO DE PIZZATTO (TANNAT) SERRA GAÚCHA', 'Elaborado desde a colheita de 2003, sempre esteve entre os mais destacados Tannat brasileiros. Está presente em pontos de referência gastronômica no Brasil e na Europa, onde com uma expressiva pontuação faz um grande sucesso. Vermelho escuro, no olfato apresenta uma mescla de aromas de frutas negras, chocolate e especiarias. Encorpado, de excelente estrutura, taninos firmes e prazerosos com longa persistência. Vinho muito premiado em sua trajetória, é uma grande oportunidade para se conhecer essa uva elegante e de personalidade marcante', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(472, 'CASA PERINI (CABERNET SAUVIGNON) VALE TRENTINO/SERRA GAÚCHA', 'Vinho de coloração rubi intensa com reflexos violáceos, que denotam excelente corpo e estrutura. Intensidade aromática com notas de frutas vermelhas predominam. Encorpado, de taninos macios integrados e um conjunto despretensioso, porém suculento, perfeito para ser desfrutado com prazer. Ótima companhia para carnes vermelhas e massas com molhos. ', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40');
INSERT INTO `produtos` (`id`, `nome`, `descricao`, `categoria_id`, `foto_url`, `created_at`, `updated_at`) VALUES
(473, 'CASA PERINI (MERLOT) VALE TRENTINO/SERRA GAÚCHA', 'De cor violeta púrpura, no olfato apresenta aromas de cerejas e baunilhas com discretas notas de café. Com taninos equilibrados e elegantes, é suave ao paladar e fácil de beber. Com ótima avaliação é um excelente Merlot nacional, um vinho prazeroso, de corpo levíssimo, que entrega mais do que o esperado. Vale a pena conhecer. ', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(474, 'CASA PERINI (TANNAT) VALE TRENTINO/SERRA GAÚCHA', 'O Perini Tannat é de coloração vermelho rubi profunda. A variedade com plantio de videiras selecionadas e a paciente maturação das frutas, produz aromas que recordam amoras, mirtilo e chocolate. Em boca, ótima estrutura e taninos agradavelmente marcantes. Nosso Tannat nacional surpreende pela maturidade, personalidade e evolução dos nossos terroirs. ', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(475, 'CASA PERINI TERROIRS (MALBEC) MENDOZA', 'Casa Perini Terroirs Malbec traz a qualidade atestada por essa vinícola e seus enólogos de um varietal icônico, com as características do terroir de Mendoza. Coloração púrpura, apresenta aroma de frutas negras em compota. No paladar trata-se de um vinho intenso, sabor elegante, taninos redondos e aveludados. Versátil na gastronomia, harmoniza com carnes vermelhas, massas com molhos e risottos marcantes.', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(476, 'CASA PERINI VIRTIS (BARBERA) VALE TRENTINO/SERRA GAÚCHA', 'A Casa Perini investiu anos de conhecimento e alta tecnologia para adaptar essa varietal rara de origem italiana aos terroirs do Vale Trentino. Após mais de dez anos de plantio das videiras, os frutos da Barbera, nobre casta europeia, revelaram sua tipicidade na Serra Gaúcha. Aroma frutado e notas delicadas de especiarias. Corpo médio, acidez perfeita, taninos aveludados e macios, redondo no paladar, completam o conjunto de muito equilíbrio. Surpreendente esse Barbera brasileiro!', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(477, 'CASA PERINI FRAÇÃO ÚNICA (PINOT NOIR) VALE TRENTINO/SERRA GAÚCHA', 'Ao longo de mais de dez anos, castas de uvas europeias certificadas, foram selecionadas e aprimoradas adaptando-se ao terroir do Vale Trentino. Os vinhos da linha Fração Única descansam e repousam em barricas de carvalho francês ou americano, para ganhar complexidade. Sua passagem em madeira confere-lhe qualidades como aromas de frutas roxas maduras, com toque de cacau e leves notas de especiarias. Na boca, taninos macios em perfeito equilíbrio com a acidez e final delicadíssimo. Oui, já fazemos franceses de qualidade!', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
(478, 'CASA PERINI FRAÇÃO ÚNICA (CABERNET FRANC) VALE TRENTINO/SERRA GAÚCHA', 'Cabernet Franc de tom vermelho rubi intenso, traz em seu bouquet aromas de frutas em compota como framboesa, cereja, aroma e nuances de uvas passas. Com seis meses de passagem em barrica de carvalho, traz ao paladar excelente equilíbrio, acidez e textura macia. Ao abrir essa garrafa, desfrute do resultado de um trabalho que começou com raízes na terra, desenvolvendo as melhores castas europeias, que tornam esses vinhos Casa Perini Premium, únicos e especiais.', 74, NULL, '2020-10-01 04:30:40', '2020-10-01 04:30:40'),
