(506, 'BECK’S STANDARD AMERICAN LAGER | ALEMANHA', '(Álcool: 5,0% - 330ml) Feita a partir da receita original de 1873, tem um sabor de corpo inteiro, buquê de lúpulo e cor dourada. Uma cerveja puro malte com sabor fresco, devido a técnicas inovadoras que a cervejaria criou em 1993. ', 84, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(507, 'CORONA EXTRA STANDARD AMERICAN LAGER | MÉXICO', '(Álcool: 4,6% - 355ml) Possui baixa graduação alcóolica, com sabor leve e refrescante. Ah, uma fatia de limão no gargalo transforma a experiência em algo ainda mais especial, reforçando a acidez e o toque cítrico da Corona!', 84, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(508, 'COLORADO CAUIM PREMIUM AMERICAN LAGER | BRASIL', '(Álcool: 4,5% - 600ml) Cerveja de coloração dourada, com espuma branca, leve e refrescante. Doçura discreta e o perfeito casamento com os aromas e sabores do lúpulo, da levedura e da mandioca.', 84, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(509, 'COLORADO RIBEIRÃO LAGER PREMIUM AMERICAN LAGER | BRASIL', '(Álcool: 4,5% - 600ml) Coloração dourada, translúcida. Leve aroma de grãos de malte. No sabor, início e final equilibrando leve dulçor com amargor, notas de malte, grãos e lúpulo. Para complementar a receita é adicionada a casca de laranja. Assim, o aroma não deixa escapar todo o aspecto frutado e cítrico da bebida. Uma lager leve e refrescante, acima da média. Vale a pena experimentar!', 84, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(510, 'DAMA AMERICAN LAGER PREMIUM AMERICAN LAGER | BRASIL', '(Álcool: 4,5% - 600ml) Cerveja suave que possui a combinação de três variedades de lúpulo e uma de malte, que resulta em um aroma cheio de personalidade com notas de frutas tropicais e cítricas. No sabor, o malte proporciona equilíbrio, o amargor é elegante e o lúpulo surpreende com notas cítricas. O aftertaste é refrescante e pede outro gole! ', 84, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(511, 'DAMA PILSEN PREMIUM AMERICAN LAGER | BRASIL', '(Álcool: 4,8% - 600ml) Cor dourada, aroma com personalidade maltada e suaves notas de lúpulo. O sabor é predominantemente maltado com médio amargor, gerando um bom equilíbrio e proporcionando uma bela refrescância.', 84, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(512, 'BURGMAN CASANOVA PREMIUM AMERICAN LAGER | BRASIL', '(Álcool: 5,0% - 600ml) Lager de baixa fermentação, que tem nos lúpulos a sua alma. Passa pelo processo de dry-hopping, em que uma quantidade generosa de lúpulo é adicionada após a maturação, resultando num amargor limpo, sutil e refrescante. ', 84, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(513, 'SP330 LAST KISS AMERICAN LAGER | BRASIL', '(Álcool: 4,6% - 500ml) Uma releitura que fica entre uma pilsen, com o tradicional lúpulo tcheco Saaz e suas notas levemente picantes e herbais, e uma american lager com uma carga levemente maior de lúpulo Citra, que entrega aromas de frutas cítricas. Na boca, um leve dulçor de malte, com notas de cereais e pão, acompanhadas de um amargor moderado e equilibrado. Uma cerveja refrescante e fácil de beber. ', 84, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(514, 'RED STRIPE JAMAICAN LAGER | JAMAICA', '(Álcool: 4,7% - 330ml) Apresenta uma coloração clara, tem um sabor refrescante, levemente hoppy com amargor suave. Bem equilibrada, ideal para dias quentes! ', 84, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(515, 'SP330 SUPERSTITION AMERICAN PALE ALE | BRASIL', '(Álcool: 5,0% - 500ml) Inspirada em uma maravilhosa música composta por Stevie Wonder e Jeff Beck, é uma cerveja muito aromática e refrescante, com maltes especiais que harmonizam com o lúpulo americano, ideal para boas companhias e bons momentos.', 85, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(516, 'DAMA QI AMERICAN PALE ALE | BRASIL', '(Álcool: 4,5% - 600ml) Uma típica APA de coloração dourada, espuma de boa formação e ótima drinkability. Apresenta nos aromas e sabores notas cítricas com leve amargor e herbal.', 85, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(517, 'LEFFE BLOND BELGIAN BLOND ALE | BÉLGICA', '(Álcool: 6,6% - 330ml) Cerveja com uma coloração entre dourado escuro e âmbar, tem um aroma adocicado e frutado, com um toque de banana e um final com baunilha e cravo da índia. Seu colarinho é generoso e o sabor é doce e frutuoso. ', 86, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(518, 'ERDINGER DUNKEL DUNKELWEIZEN | ALEMANHA', '(Álcool: 5,6% - 500ml) Cerveja de trigo escura, produzida com malte torrado, encorpada, com toques tostados e notas frutadas. Fabricada seguindo uma antiga receita, que traz notas picantes e o toque típico de envelhecimento em garrafa. ', 87, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(519, 'INVICTA HELLBEIRÃO PILS GERMAN PILSENER | BRASIL', '(Álcool: 4,5% - 500ml) Apresenta coloração limpa e brilhante, no aroma, notas de malte e cereais evidentes, seguidas da presença floral do lúpulo. O sabor segue o aroma, oferecendo uma percepção suave e equilibrada na boca permitindo que ela seja a pedida ideal para dias de calor. ', 88, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(520, 'BURGMAN IPA HOP AMERICAN IPA | BRASIL', '(Álcool: 6% - 600ml) De cor amarelo escuro/dourada, levemente turva, passa por dry-hopping de lúpulos Cascade, Mandarina Bavaria e Amarillo. O amargor é intenso e refrescante. No aroma notas cítricas e de frutas tropicais são bem evidentes. Uma excelente opção para amantes do lúpulo e das cervejas de pegada norte americana! ', 89, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(521, 'COLORADO INDICA INDIA PALE ALE | BRASIL', '(Álcool: 7,5% - 600ml) Utiliza lúpulos ingleses, malte convencional e tostado, o que justifica seu amargor e sua coloração âmbar levemente escura. No aroma encontramos notas herbais em uma bebida de corpo médio e boa drinkability. Detalhe: com um toque especial da rapadura.', 89, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(522, 'DAMA IPA INDIA PALE ALE | BRASIL', '(Álcool: 6,5% - 600ml) Possui cor âmbar, seu aroma passeia por tons cítricos e por notas maltadas. Os sabores seguem as características do aroma, com sabor e amargor do lúpulo contracenando harmoniosamente com os delicados dulçores dos maltes.', 89, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(523, 'DAMA TUPI WEST COAST RYE IPA | BRASIL', '(Álcool: 7,5% - 500ml) De cor dourado escuro, com aromas que remetem a notas cítricas, condimentadas e resinosas. No sabor, a utilização de centeio nesta receita exclusiva confere características picantes, seguida de um amargor marcante. Uma experiência sensorial inesquecível. ', 89, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(524, 'INVICTA NEW SENSESSION SESSION IPA | BRASIL', '(Álcool: 4,6% - 500ml) Cerveja de base clara, espuma persistente e final seco, ótima pra quem quer se refrescar e aproveitar toda citricidade e amargor moderado do lúpulo. Ótimo drinkability e baixa potência alcóolica, evidenciando o aroma cítrico e frutado do lúpulo Mosaic utilizado no Dry Hop.', 89, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(525, 'INVICTA 6 O’CLOCK AMERICAN IPA | BRASIL', 'R$38,40(Álcool: 5,8% - 500ml) Aroma frutado e cítrico proveniente dos lúpulos com notas de manga e maracujá. Amargor médio que persiste sem ser agressivo, ótima drinkability, equilibrada, refrescante e de corpo médio leve. Uma Session IPA padrão Invicta.', 89, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(526, 'INVICTA BOSS IMPERIAL IPA | BRASIL', '(Álcool: 8% - 500ml) De cor cobre e translúcida, mistura o sabor levemente doce dos maltes com o amargor e aroma floral da dosagem generosa de lúpulo. No aroma apresenta notas cítricas, frutadas e herbal. Uma cerveja ousada e muito saborosa! ', 89, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(527, 'SP330 CALIFORNICATION AMERICAN IPA | BRASIL', '(Álcool: 6,5% - 500ml) O blend de lúpulos composto pelas variedades americanas: Magnum, Centennial, Amarillo, Mosaic e Cascade, explodem tanto no aroma quanto no sabor com amargor intenso e notas frutadas, cítricas, resinosas e florais. O dulçor do malte entra em segundo plano para equilibrar esta bela cerveja, como uma boa IPA da escola americana deve ser.', 89, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(528, 'VEDETTE IPA INDIA PALE ALE | BÉLGICA', '(Álcool: 5,5% - 330ml) De coloração cobre e ligeiramente turva. Possui aromas de frutas cítricas e tropicais, notas verdes e florais. Paladar elegantemente amargo e muito refrescante.', 89, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(529, 'BURGMAN RED FLANDERS RED ALE | BRASIL', '(Álcool: 5,5% - 600ml) Cerveja avermelhada e complexa. Mistura de receitas belga e inglesa. Produzida com maltes caramelizados, seu aroma apresenta notas de ameixa, baunilha, madeira e frutas vermelhas. Paladar agradavelmente caramelizado e seco, com notas de tostado e madeira. Uma ótima opção para acompanhar a boa gastronomia!', 90, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(530, 'INVICTA SAISON À TROIS SAISON/FARMHOUSE ALE | BRASIL', '(Álcool: 5,8% - 500ml) Uma Saison estilo belga bem refrescante, com leve acidez e um toque delicado de semente de coentro. Notas de pêssego e abacaxi somam a notas fenólicas de cravo e cítrico. O aftertaste é delicioso. Alta drinkability. Cerveja frutada e refrescante! ', 91, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(531, 'GUINESS DRAUGHT STOUT | IRLANDA', '(Álcool: 4,1% - 440ml) De cor negra e uma excepcional espuma densa, cremosa e persistente. Aromas e sabores de café e chocolate amargo bastante presentes. O lúpulo utilizado confere um sabor marcante, com excelente balanço entre o amargor e a doçura.', 92, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(532, 'PAULANER HEFE WEISSBIER GERMAN WEIZEN | ALEMANHA', '(Álcool: 5,5% - 500ml) Cerveja de trigo sutilmente amarga, não filtrada e de cor amarela turva. Possui o clássico aroma do estilo Weiss de cravo e banana. Com sabores frutados, malte adocicado e cravo, o sabor se assemelha muito aos aromas.', 93, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(533, 'PAULANER SEM ÁLCOOL GERMAN WEIZEN | ALEMANHA', '(Álcool: 5,5% - 500ml) Cerveja de trigo sutilmente amarga, não filtrada e de cor amarela turva. Possui o clássico aroma do estilo Weiss de cravo e banana. Com sabores frutados, malte adocicado e cravo, o sabor se assemelha muito aos aromas.', 93, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(534, 'COLORADO APPIA WEIZEN | BRASIL', '(Álcool: 5,5% - 600ml) Cerveja de trigo com mel de flor de laranjeira. É feita a partir de cevada, trigos maltados e uma exclusiva levedura de alta fermentação. Doce, encorpada e refrescante, agrada a todos os paladares, é perfeita para quem busca novos e diferentes sabores.', 93, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(535, 'DAMA WEISS WEIZEN | BRASIL', '(Álcool: 5,0% - 600ml) Uma autêntica cerveja artesanal de trigo. Apresenta coloração amarelo palha, possui natural turbidez, com aromas e sabores frutados, de banana e cravo, que resultam em uma cerveja deliciosamente refrescante!', 93, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(536, 'ERDINGER WEISSBIER WEIZEN | ALEMANHA', '(Álcool: 5,3% - 500ml) Típica e tradicional cerveja de trigo sem filtração. Cremosa e refrescante, muito aromática, com as tradicionais notas de banana, cravo e toques maltados. Tem um sabor incomparável, além de ser um clássico entre as cervejas de trigo! ', 93, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(537, 'HOEGAARDEN WITBIER | BÉLGICA', '(Álcool: 4,9% - 330ml) Cerveja clássica belga, de cor naturalmente turva e clara. Apresenta aroma de casca de laranja, limão, coentro e especiarias. Seu sabor é característico e original, suave, ao mesmo tempo doce e azeda, com um sutil sabor cítrico e temperado. Uma cerveja elegante, refrescante e deliciosa!', 94, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(538, 'VEDETTE WITBIER | BÉLGICA', '(Álccol: 4,7% - 330ml) De coloração amarela clara turva, com espuma densa e cremosa. Esta cerveja belga apresenta um aroma frutado, com notas de laranja e limão siciliano. Paladar seco e extremamente refrescante.', 94, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41'),
(539, 'BLUE MOON WITBIER |EUA', '(Álcool: 5,4% - 355ml) Apresenta coloração clara e turva, possui aroma com notas de laranja e trigo e no sabor notas de coentro e laranja. É uma cerveja extremamente refrescante!', 94, NULL, '2020-10-01 04:30:41', '2020-10-01 04:30:41');
